import internetPicture from '../Images/Internet Picture.jpg';
import JavaScript from '../Images/javascript.svg';
import './Main-module.css';

function Main() {
  return (
    
<main>

<div class="main-part-1">

    <img class="main-img" src={internetPicture} />

    <h1 class="main-title"> Hello World </h1>

</div>

<div class="main-part-2">

    <h3 class="main-title-2"> My name is Victor Lis </h3>

    <h4 class="main-text-body" id="my-years-old"> I'm 16 years old and I'm studyng programming, this website is a someone of my projects, I intend to work more on the front end. </h4>

    <h4 class="main-subtitle-2"> My favorites languages / frameworks </h4>

    <div class="main-row">

        <div class="main-collunm">

            <h4 class="main-collunm-text"> JavaScript </h4>
            <img class="main-collumn-img" src={JavaScript} />

        </div>

        <div class="main-collunm">

            <h4 class="main-collunm-text"> React </h4>
            <img class="main-collumn-img" src={React} />

        </div>

    </div>

</div>

</main>
  );
}

export default Main;
